import React, { } from 'react'
import dseImg from '../../imgs/dse.png'
import lesicImg from '../../imgs/lesic.png'
import './styles.scss'

function Home() {

    return (
        <div id='home'>

            <img src={dseImg} alt='Desenvolvimento de Software Educacional' />
            <img src={lesicImg} alt='LESIC' />
        </div>
    )
}

export default Home
